"use strict";

var $win = $(window);
var $doc = $(document);
var $header = $('.header');
var winH = $win.height();
var $sectionHead = $('.section--main .section__head-scroll');
var scrollTopCurrent = 0;
var scrollTopPast = 0;
var topLimit = 203;

function globalFunctions(){
	// $('.btn-back').on('click', function (event) {
	// 	window.history.back();
	
	// 	event.preventDefault();
	// });
	
	$('.link-popup').magnificPopup({
		type: 'ajax',
		showCloseBtn: true,
		removalDelay: 500,
		mainClass: 'mfp-fade',
		callbacks: {
			ajaxContentAdded: function ajaxContentAdded() {
				var $popup = $('.popup');
				$popup.addClass('show');
	
				$(this.container).find('.link-popup').magnificPopup({
					type: 'ajax',
					showCloseBtn: true,
					removalDelay: 500,
					mainClass: 'mfp-fade'
				});
	
				$('.btn-close-popup').on('click', function (event) {
					$.magnificPopup.close();
				});
			},
			beforeClose: function beforeClose() {
				var $popup = $('.popup');
	
				$popup.removeClass('show');
			}
		}
	});
	
	$('.btn-close-popup').on('click', function (event) {
		$.magnificPopup.close();
	});
	
	$('.field, .textarea, .checkbox').each(function () {
		animatedLabel($(this));
	}).on('change', function () {
		animatedLabel($(this));
	});
}

function swiperAddress(){
	var mySwiperAddress;
	if ($('.swiper-container-address .swiper-slide').length > 1) {
		mySwiperAddress = new Swiper('.swiper-container-address', {
			loop: false,
			speed: 1000,
			paginationClickable: true,
			'spaceBetween': 20,
			pagination: {
				el: '.swiper-container-address .swiper-pagination',
				clickable: true,
				renderBullet: function renderBullet(index, className) {
					return '<span class="' + className + '">' + '</span>';
				}
			}
		});

		return mySwiperAddress;
	}
}

function initVars(){
	 $win = $(window);
	 $doc = $(document);
	 $header = $('.header');
	 winH = $win.height();
	 $sectionHead = $('.section--main .section__head-scroll');
	 scrollTopCurrent = 0;
	 scrollTopPast = 0;
	 topLimit = 203;
}

function navTrigger(){

	initVars();

	$('body').on('click', '.nav-trigger',function (event) {
		event.preventDefault();

		$('.nav__wrapper').toggleClass('visible');
		$('.container').toggleClass('container-moved');
		$('.header').toggleClass('moved');
		$('.footer').toggleClass('moved');
		$('.nav-overlay').toggleClass('visible');
	});

	$('body').on('click', '.nav-trigger-close', function (event) {
		event.preventDefault();
	
		$('.nav__wrapper').removeClass('visible');
		$('.container').removeClass('container-moved');
		$('.header').removeClass('moved');
		$('.footer').removeClass('moved');
		$('.nav-overlay').removeClass('visible');
	});

	$('body').on('click', '.nav-overlay',function (event) {
		event.preventDefault();
	
		$('.nav__wrapper').removeClass('visible');
		$('.container').removeClass('container-moved');
		$('.header').removeClass('moved');
		$('.footer').removeClass('moved');
		$('.nav-overlay').removeClass('visible');
	});

	function animate(winST) {
		$('.animations').each(function () {
			if (winST + winH * 0.95 > $(this).offset().top) {
				var animClass = $(this).data('animation');
	
				if (!$(this).hasClass('animated')) {
					$(this).addClass('animated');
					$(this).addClass(animClass);
				}
			}
		});
	};
	
	$win.on('load scroll', function () {
		var winST = $win.scrollTop();
	
		animate(winST);
	
		scrollTopCurrent = $win.scrollTop();
		topLimit = $win.width() > 1024 ? 203 : 75;

		$header.toggleClass('fixed', scrollTopCurrent > topLimit);
		$header.toggleClass('shown', scrollTopCurrent < scrollTopPast);
	
		$sectionHead.toggleClass('fixed', scrollTopCurrent > topLimit);
		$sectionHead.toggleClass('shown', scrollTopCurrent < scrollTopPast);
	
		setTimeout(function () {
			scrollTopPast = scrollTopCurrent;
		}, 500);
	});
}


function playVideo(){
	 document.getElementById('videoPlayer').load();
	 document.getElementById('videoPlayer').addEventListener('playing', function(){
           $('.video').addClass('play');
    })
     document.getElementById('videoPlayer').addEventListener('pause', function(){
           $('.video').removeClass('play');
    })

	$('.btn--play').on('click', function (event) {
		//event.preventDefault();
		document.getElementById('videoPlayer').play();
		setTimeout(function(){
		document.getElementById('videoPlayer').play();
		}, 1500);
		//$('.video').toggleClass('play');
	});
}

function initSwipers(){
		if ($('.swiper-container-images .swiper-slide').length > 0) {
		var swiperImages = new Swiper('.swiper-container-images', {
			loop: false,
			effect: 'fade',
			speed: 1000,
			paginationClickable: true,
			'spaceBetween': 0,
			pagination: {
				el: '.swiper-container-images .swiper-pagination',
				clickable: true,
				renderBullet: function renderBullet(index, className) {
					return '<span class="' + className + '">' + '</span>';
				}
			}
		});
	}

	if ($('.swiper-container-images--secondary .swiper-slide').length > 0) {
		var swiperImagesSecondary = new Swiper('.swiper-container-images--secondary', {
			loop: false,
			effect: 'fade',
			speed: 1000,
			paginationClickable: true
		});
	}

	if ($('.swiper-container-features .swiper-slide').length > 0) {
		var swiperFeatures = new Swiper('.swiper-container-features', {
			loop: false,
			speed: 1000,
			slidesPerView: 'auto',
			paginationClickable: true,
			pagination: {
				el: '.swiper-container-features .swiper-pagination',
				clickable: true,
				renderBullet: function renderBullet(index, className) {
					return '<span class="' + className + '">' + '</span>';
				}
			}
		});
	}
}

