function animatedLabel($element) {
	if ($element.val() != "") {
		$element.addClass('changed');
	} else {
		$element.removeClass('changed');
	}
}

function switchPanels(){
	var activeTabClass = 'current';

	$('.tabs__nav a').on('click', function (event) {
		event.preventDefault();

		var $tabLink = $(this);
		var $targetTab = $($tabLink.attr('href'));

		$('.tab.current').addClass('translating');

		setTimeout(function () {
			$('.tab.current').removeClass('translating');

			$tabLink.parent().add($targetTab).addClass(activeTabClass).siblings().removeClass(activeTabClass).removeClass('translating-in');

			setTimeout(function () {
				$('.tab.current').addClass('translating-in');
			}, 10);

			swiperAddress.update();
		}, 500);
	});
}

